import React from 'react'
import '../Wall/Wall.scss'
// import img from '../../assets/images/13.png'

function Wall({img}) {
    console.log({img})
    return (
        <>
            <div className="col col-lg-7 col-12">
                <img className='mx-auto d-block' src={img} alt="" />
            </div>
        </>
    )
}

export default Wall
